/**
 * @author [Alex Neo]
 * @email [alex.neo0115@gmail.com]
 * @create date 2022-01-12 19:33:03
 * @modify date 2022-01-12 19:33:03
 * @desc [create counter view]
*/
import React from "react";
import PropTypes from "prop-types";
import { Button } from "antd";
import {
    UpCircleFilled,
    DownCircleFilled,
    EditOutlined
} from "@ant-design/icons";


const CounterView = ({ value, onIncreaseClick, onDecreaseClick }) => (
	<div style={{width:'250px', height:'100px'}}>
        <span style={{color:'#FFF'}}>{value}</span>
        <Input placeholder="default size" prefix={<EditOutlined />} />
        <br />
        <Button onClick={onIncreaseClick} icon={<UpCircleFilled />}></Button>
        <Button onClick={onDecreaseClick} icon={<DownCircleFilled />}></Button>
    </div>
);


CounterView.propTypes = {
	value: PropTypes.number.isRequired,
	onIncreaseClick: PropTypes.func.isRequired,
	onDecreaseClick: PropTypes.func.isRequired
};

export default CounterView;
